INSERT INTO `news_articles` (`id`, `author`, `title`, `desc`, `text`, `votes`, `date`, `bgImgSrc`) VALUES
(1, 'Long Rover', 'Анонс сайта и форума', 'Описание', 'Доброго времени суток, дорогие друзья!<br>\r\nМы долгое время были в тишине, и время уже пришло поделиться с вами о нашей проделанной работе. <br>\r\nТем временем, пока наша команда готовит крупные обновления игрового мода, о которых вы узнаете несколько позже, <br>\r\nнаша команда параллельно разработала сайт и форум проекта. Более того, это ещё не окончательная версия сайта. <br>\r\nЗа новостями проекта вы можете следить на наших ресурсах.<br>\r\n<br>\r\n<a href=\"//unionrp.ru\">http://unionrp.ru</a><br>\r\n<a href=\"//unionrp.ru/forum\">http://unionrp.ru/forum</a><br>\r\n<br>Не забываем следить за нашими ресурсами: <br>\r\n<a href=\"//vk.com/gtafive_news\">https://vk.com/gtafive_news</a> (Официальная страница ВК)<br>\r\n<a href=\"//vk.com/gtafive_free\">https://vk.com/gtafive_free</a> (Свободная группа ВК)<br>\r\n<a href=\"//discordapp.com/invite/vsGrtDN\">https://discordapp.com/invite/vsGrtDN</a> (Официальный дискорд канал)<br>\r\n<a href=\"//t.me/gtafive_rp\">https://t.me/gtafive_rp</a> (Официальный телеграм канал)<br>\r\n<br>\r\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/Iqr8nVFvxLw\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>', 66, 1545921026, 'https://unionrp.ru/image/news/cover/news_cover_1.png'),
(2, 'Artyom Slyadnev', 'Регистрация и авторизация', '', 'При входе на сервер, Вас ожидает приветствие. Которое исчезает после нажатия любой клавиши.<br><br>\r\n<img src=\"https://pp.userapi.com/c851020/v851020795/b2f35/7codExLfpK4.jpg\"><p>\r\nПосле чего, вас ждёт окно входа. Регистрация - один из уникальнейших процессов нашего проекта. <br>\r\nЧтобы зарегистрировать свой первый аккаунт, Вам достаточно выполнить несколько простых действий:<br>\r\n<br>\r\n• Введите своё имя и фамилию.<br>\r\n• Выберите пол: мужской или женский.<br>\r\n• Укажите свою страну и город, а также адрес электронной почты.<br>\r\n• Придумайте уникальный логин и надёжный пароль.<br>\r\n<br>\r\nПерсональные данные мы запрашиваем в целях безопасности вашего аккаунта, на случай восстановления.<br>\r\n<br>\r\nТеперь достаточно повторить пароль в окне \"подтвердите пароль\", и нажать кнопку \"зарегистрироваться\".<br><br>\r\n<img src=\"https://pp.userapi.com/c845416/v845416912/19f01e/qXU6bxJnohU.jpg\"><p>\r\nПосле окончания регистрации, нужно войти в учётную запись использую указанные данные при регистрации аккаунта. После чего создаём своего character.<br>\r\nИспользуя активные окна, выберите подходящие параметры: наследственность, одежда, и раса.<br>\r\n<br>\r\nСтарайтесь выбирать тщательно, ведь Change некоторые детали внешнего вида впоследствии будет невозможно.<br><br>\r\n<img src=\"https://pp.userapi.com/c851020/v851020795/b2f23/1jIuTzHGe0I.jpg\"><p>\r\n<img src=\"https://pp.userapi.com/c845416/v845416912/19f056/oV8Q9_VeW3Y.jpg\"><p>\r\n<img src=\"https://pp.userapi.com/c845416/v845416912/19f092/8timEkLDx1Y.jpg\"><p>\r\nДля того, чтобы снова войти в аккаунт, Вам нужно ввести свой логин и пароль, после чего выбрать ячейку с определённым персонажем.<br><br>\r\n<img src=\"https://sun9-30.userapi.com/c845416/v845416912/19f0a3/DA0IH4Gi4Ws.jpg\"><p>\r\n<img src=\"https://pp.userapi.com/c845416/v845416912/19f0ad/ZOstTzuGD9M.jpg\"><p>\r\nЕсли вы забыли пароль от своего аккаунта, вы с лёгкостью можете его восстановить. <br>\r\nКоманда проекта Union Role Play заботится о безопасности своих игроков, поэтому мы ввели несколько вариантов защиты.<br><br>\r\n<img src=\"https://pp.userapi.com/c847217/v847217354/190e08/JUVSqSLFkGE.jpg\"><p>\r\n<img src=\"https://pp.userapi.com/c847217/v847217354/190e12/tQO7h_WWwyw.jpg\"><p>\r\n<img src=\"https://pp.userapi.com/c848620/v848620354/1246b2/xuJISVnzfb4.jpg\"><p>\r\nСпасибо Вам за прочтение данной статьи. Вы можете поддержать нас, вступив в группу проекта, лайкнув и репостнув этот пост.<br>\r\n<br>\r\nТак же предлагаем Вам вступить в наш сервер дискорд: <br>\r\n<a href=\"//discord.gg/cK3JEgK\">https://discord.gg/cK3JEgK</a> <br>\r\n<br>\r\nС уважением, команда проекта Union Role Play.<br>', 87, 1549464026, 'https://unionrp.ru/image/news/cover/news_cover_2.png'),
(3, 'Artyom Slyadnev', 'Игровое меню, худ и чат', '', 'Игровое меню на нашем проекте представляет собой систему активных окон с несколькими пунктами. Один из них: \"Аккаунт\".<br>\r\n<br>\r\nВ графе \"Аккаунт\" Вы можете посмотреть свой игровой Level, количество проведённых в игре Hours, рейтинг, а также количество созданных Characters.<br>\r\n<br>\r\n<img src=\"https://pp.userapi.com/c847221/v847221691/1997ab/BuaPiI4c8eQ.jpg\"><p>\r\nВ графе \"Персонаж\" содержится основная информация о нём:<br>\r\n<br>\r\n• Транспортные средства, находящиеся в собственности игрового character.<br>\r\n• Недвижимое имущество: жильё и бизнес.<br>\r\n• Информация о организации, в которой состоит Ваш персонаж.<br>\r\n• Skills character и их Level.<br>\r\n<br>\r\n<img src=\"https://pp.userapi.com/c847221/v847221691/1997b5/UVF9hBoU67w.jpg\"><p>\r\nПример графы \"Персонаж» с активным персонажем(не стоит обращать внимание на отсутствие худа и некоторых элементов т.к. скриншот прошлого года):<br>\r\n<br>\r\n<img src=\"https://pp.userapi.com/c851532/v851532954/b72ec/mOnvtTqvNDw.jpg\"><p>\r\nНа нашем проекте также присутствует система достижений, которые можно выполнять для повышения уровня и прокачки character.<br>\r\nНа задания не стоит акцентировать внимание(разработка достижений в процессе).<br>\r\n<br>\r\n<img src=\"https://pp.userapi.com/c847221/v847221691/1997c9/mF0j9AA8rJo.jpg\"><p>\r\nВ организациях также можно заработать специальные достижения. Выполняйте их и повышайте свой авторитет среди коллег!<br>\r\n<br>\r\nЕсли Вы заметили нарушителя или нашли недоработку в одной из систем проекта, обратитесь в репорт.<br>\r\nК Вашей жалобе прислушаются и накажут нарушителя, или исправят недоработку.<br>\r\n<br>\r\nВозможно Вас вознаградят за помощь проекту.<br>\r\n<br>\r\n<img src=\"https://pp.userapi.com/c847221/v847221691/1997db/_3l6kNOtb5Y.jpg\"><p>\r\nВ любой хорошей игре должны присутствовать настройки. Наш проект не исключение.<br>\r\n<br>\r\n<img src=\"https://pp.userapi.com/c847221/v847221691/1997e5/EcRnwTerafM.jpg\"><p>\r\nВ настройках Вы можете сменить пароль, в целях повышения безопасности, привязать к аккаунту свою электронную почту, или настроить под себя некоторые настройки character.<br>\r\n<br>\r\nРаздел \"Магазин\" позволяет Вам пополнить свой игровой счёт, просмотреть историю пополнений, а также PURCHASE один из PACKAGEов Union RolePlay.<br>\r\n<br>\r\n<img src=\"https://pp.userapi.com/c847221/v847221691/1997ef/pDlUqXI3cqs.jpg\"><p>\r\nВы не могли не обратить внимание на худ, точнее на его наработки. Который можно отключать и настраивать в настройках интерфейса.<br>\r\nНа данный момент худ включает в себя: логотип проекта, наименование сервера, онлайн, реальное время по МСК, дату, иконку войс чата и телефона.<br>\r\nСтоит отметить, что иконка войс чата и телефона при активации подсвечивается зелёным цветом, но об этом мы расскажем позже.<br>\r\n<br>\r\n<img src=\"https://pp.userapi.com/c847221/v847221691/199811/HWFWKn0rEYs.jpg\"><p>\r\nНу и заключительная новость, это игровой чат. Который предоставлен в двух вариациях, а именно — левосторонний и правосторонний.<br>\r\nВ том числе имеется возможность отключения чата. Да, совсем забыли, переключатель тегов работает по клавише Tab.<br>\r\n<br>\r\n<img src=\"https://pp.userapi.com/c852020/v852020796/b341c/Al8slzUl0g8.jpg\"><p>\r\n<img src=\"https://pp.userapi.com/c847120/v847120691/197f13/pUMXUTHyYK8.jpg\"><p>\r\n<img src=\"https://pp.userapi.com/c845220/v845220691/19f691/zbttkLzjmIk.jpg\"><p>\r\nСпасибо Вам за прочтение данной статьи. Вы можете поддержать нас, вступив в группу проекта, лайкнув и репостнув этот пост.<br>\r\n<br>\r\nТак же предлагаем Вам вступить в наш сервер дискорд: <br>\r\n<a href=\"//discord.gg/cK3JEgK\">https://discord.gg/cK3JEgK</a> <br>\r\n<br>\r\nС уважением, команда проекта Union Role Play.<br>', 99, 1549818326, 'https://unionrp.ru/image/news/cover/news_cover_3.png'),
(4, 'Artyom Slyadnev', 'Инвентарь character', '', '\"Инвентарь character\" на нашем проекте представляет собой большое активное меню, при взаимодействии с которым,<br>\r\nигрок может идеально распределить свои вещи или освободить место для новых.<br>\r\nВ инвентаре character могут находиться различные вещи, количество которых довольно таки большое.<br>\r\n<br>\r\n<img src=\"https://pp.userapi.com/c850728/v850728190/b5c7f/tUYCSXriaC0.jpg\"><p>\r\nВ меню \"Инвентарь\" Вы можете узнать, какие вещи находятся: в карманах брюк, в куртке, в руках, и даже в Вашей сумке.<br>\r\n<br>\r\n<img src=\"https://pp.userapi.com/c850728/v850728190/b5c9b/0ODAO4AJ9yI.jpg\"><p>\r\nТакже можно надеть различные аксессуары и вещи, например: серьги, головной убор, очки, галстук, часы, браслет,<br>\r\nбронежилет, сумка, маска, перчатки, обувь, верхнюю и нижнюю одежду.<br>\r\n<br>\r\n<img src=\"https://pp.userapi.com/c850728/v850728190/b5cb2/tvNVhtrihWs.jpg\"><p>\r\nПри ненадобности Вы можете выкинуть лишние вещи из инвентаря. Помните: у Вас есть 30 килограмм места на всё ваше снаряжение и аксессуары,<br>\r\nв скором времени общий вес character будет зависеть от силовых показателей.<br>\r\n<br>\r\n<img src=\"https://pp.userapi.com/c850728/v850728190/b5cc5/Inm4fgvIj1I.jpg\"><p>\r\nВещи и предметы можно выбрасывать из инвентаря или одежды. А так-же поднимать их, с помощью клавиши E.<br>\r\n<br>\r\n<img src=\"https://pp.userapi.com/c850728/v850728190/b5cd7/0nuXcvzKij0.jpg\"><p>\r\n<img src=\"https://pp.userapi.com/c852028/v852028190/b3e79/7IONk7KIk7g.jpg\"><p>\r\nТак-же есть возможность положить предметы слоты верхней одежды, затем положить верхнюю одежду вместе с предметами в сумку,<br>\r\nпри этом предметы остаются на месте. С левой стороны будет прочий инвентарь, как пример — шкаф, Sullenажник и прочее.<br>\r\n<br>\r\nВ руках есть возможность использования различного оружия, о системе который мы расскажем немного позже.<br>\r\n<br>\r\nНа худ и логотип не обращайте внимание, скриншоты прошлого года. Худ уже доработан, об этом мы уже объявили в ранней статье.<br>\r\n<br>\r\nСпасибо Вам за прочтение данной статьи. Вы можете поддержать нас, вступив в группу проекта, лайкнув и репостнув этот пост.<br>\r\n<br>\r\nТак же предлагаем Вам вступить в наш сервер дискорд: <br>\r\n<a href=\"//discord.gg/cK3JEgK\">https://discord.gg/cK3JEgK</a> <br>\r\n<br>\r\nС уважением, команда проекта Union Role Play.<br>', 95, 1549899926, 'https://unionrp.ru/image/news/cover/news_cover_4.png'),
(5, 'Artyom Slyadnev', 'Спидометр, взаимодействие с characterми и транспортом', '', 'Итак, начнём со спидометра. Обратите внимание на подсветку, при заведённом двигателе, спидометр загорается, в противном случае тухнет.<br>\r\nВполне реалистично, согласны? Дальше, индикаторы, которые информируют игрока о неисправностях транспортного средства.<br>\r\nНемаловажную роль играет одометр, который фиксирует общее количество километров, пройденные транспортом за определённое время.<br>\r\nИндикатор количества топлива всегда уведомит игрока о пустом баке. Индикатор центрального замка, который уведомляет игрока о том,<br>\r\nчто в транспорте открыты/закрыты двери. Индикатор поворотников, ремня, фар и другое.<br>\r\n<br>\r\n<img src=\"https://pp.userapi.com/c850220/v850220116/d9abc/jSeslttr_nk.jpg\"><p>\r\n<img src=\"https://pp.userapi.com/c850020/v850020116/1292ee/UcK-PFIyAtI.jpg\"><p>\r\n<img src=\"https://pp.userapi.com/c850020/v850020116/1292f8/JmIw-kvAM7k.jpg\"><p>\r\nВ процессе взаимодействия с игроком вы можете:<br>\r\n• Поздороваться.<br>\r\n• Показать документы.<br>\r\n• Торговаться.<br>\r\n<br>\r\n<img src=\"https://pp.userapi.com/c850220/v850220500/d70f0/DWmfCaImhpc.jpg\"><p>\r\n<img src=\"https://pp.userapi.com/c850020/v850020500/1234e0/Y9bArDbCkRA.jpg\"><p>\r\nОкно подтверждения при взаимодействии:<br>\r\n<br>\r\n<img src=\"https://pp.userapi.com/c850220/v850220500/d7104/oMjLlWRQDRI.jpg\"><p>\r\nЕсли вы состоите во фракции, у вас имеются дополнительные возможности для взаимодействия.<br>\r\n<br>\r\n<img src=\"https://pp.userapi.com/c850220/v850220500/d7117/_xwdihDPh8U.jpg\"><p>\r\n<img src=\"https://pp.userapi.com/c850020/v850020500/1234f2/VNAWHp6klqM.jpg\"><p>\r\n<img src=\"https://pp.userapi.com/c850020/v850020500/1234fc/wd0pGNC1eP0.jpg\"><p>\r\nВ процессе взаимодействия с транспортом вы можете:<br>\r\n• Открыть/закрыть двери.<br>\r\n• Посмотреть капот.<br>\r\n• Посмотреть Sullenажник.<br>\r\n<br>\r\n<img src=\"https://pp.userapi.com/c850220/v850220500/d712a/TzHgrPbLw2Q.jpg\"><p>\r\nСтоит подметить, что возможности взаимодействия будут увеличиваться, и более того, это произойдёт до открытия. Так же, что у каждой фракции свои возможности для взаимодействия.\r\n<br>\r\nСпасибо Вам за прочтение данной статьи. Вы можете поддержать нас, вступив в группу проекта, лайкнув и репостнув этот пост.<br>\r\n<br>\r\nТак же предлагаем Вам вступить в наш сервер дискорд: <br>\r\n<a href=\"//discord.gg/cK3JEgK\">https://discord.gg/cK3JEgK</a> <br>\r\n<br>\r\nС уважением, команда проекта Union Role Play.<br>', 85, 1549972826, 'https://unionrp.ru/image/news/cover/news_cover_5.png'),
(6, 'Artyom Slyadnev', 'Инвентарь обмена/торговли', '', 'Иногда бывает просто необходимо договориться с кем-либо или добыть определённую вещь.<br>\r\nДля таких случаев на нашем проекте существует система инвентаря обмена/торговли.<br>\r\nНа отсутствие худа не обращайте внимание, скриншот был сделан давно.<br>\r\n<br>\r\n<img src=\"https://pp.userapi.com/c846418/v846418420/1a410d/XTy8FbKUYLY.jpg\"><p>\r\n\"Инвентарь обмена/торговли\" представляет собой активное окно, разделённое на несколько частей.<br>\r\nВ нижней части окна находится чат, с помощью которого можно договориться с игроком.<br>\r\nПосле нажатия кнопки \"Принять\", вы готовы к обмену.<br>\r\nИгроки могут обмениваться самыми разными предметами: пачка денег, шляпа, часы или другой аксессуар,<br>\r\nнаркотики, ключи от автомобиля - всё это можно передать другому игроку.<br>\r\n<br>\r\nДля того, чтобы совершить обмен, один из игроков выполняет ряд действий и нажимает кнопку «Готов»,<br>\r\nпосле чего второй игрок может согласиться на проведение сделки, нажав кнопку «Готов».<br>\r\nСледите за своим инвентарем и не попадайтесь на уловки мошенников!<br>\r\n<br>\r\n<img src=\"https://pp.userapi.com/c846418/v846418420/1a4152/jn4iGHT8ecQ.jpg\"><p>\r\n<br>\r\nСпасибо Вам за прочтение данной статьи. Вы можете поддержать нас, вступив в группу проекта, лайкнув и репостнув этот пост.<br>\r\n<br>\r\nТак же предлагаем Вам вступить в наш сервер дискорд: <br>\r\n<a href=\"//discord.gg/cK3JEgK\">https://discord.gg/cK3JEgK</a> <br>\r\n<br>\r\nС уважением, команда проекта Union Role Play.<br>', 89, 1550059226, 'https://unionrp.ru/image/news/cover/news_cover_6.png'),
(7, 'Artyom Slyadnev', 'Документы', '', 'Для совершения некоторых операций и использования новых возможностей на нашем проекте существует система документов.<br>\r\nДокументы необходимы каждому игровому персонажу, иначе пребывание в штате станет для него тяжёлым.<br>\r\nПросмотр документов происходит через инвентарь.<br>\r\n<br>\r\n<img src=\"https://pp.userapi.com/c846418/v846418420/1a416f/oBvFFy4wf0w.jpg\"><p>\r\nВажнейший документ character - паспорт. В паспорте указана основная информация о персонаже: ФИО, дата рождения,<br>\r\nвозраст, место проживания и семейное положение. Паспорт character могут потребовать сотрудники полиции при проверке.<br>\r\n<br>\r\n<img src=\"https://pp.userapi.com/c846418/v846418420/1a4165/U1zFI3lJ_h4.jpg\"><p>\r\nНемаловажными для character являются PACKAGE лицензий. Без License не имеет права носить и использовать огнестрельное оружие.<br>\r\nТакже в PACKAGE лицензий входят водительские права, лицензия на бизнес, лицензия на владение и управление морским судном.<br>\r\nВ случае отсутствия определённых лицензий, сотрудники полиции могут наказать игрока.<br>\r\n<br>\r\n<img src=\"https://pp.userapi.com/c846418/v846418420/1a4179/S8e9utsXk5Y.jpg\"><p>\r\n<img src=\"https://pp.userapi.com/c852224/v852224045/aac30/BxbtytBM-qE.jpg\"><p>\r\nВыписка из тира, в ней вы можете просмотреть владение тем или иным типом оружия, Skills владением оружия можно улучшать в стрельбищах,<br>\r\nлибо при перестрелках в криминальных структурах.<br>\r\n<br>\r\n<img src=\"https://pp.userapi.com/c846418/v846418420/1a4183/ZOaWNVIcf1c.jpg\"><p>\r\nСледующий, не менее важный документ - трудовая книга. Трудовая книга содержит в себе всю карьерную историю Вашего character.<br>\r\nДату вступления в организацию, должность и и название государственной структуры можно посмотреть тут.<br>\r\n<br>\r\n<img src=\"https://pp.userapi.com/c846418/v846418420/1a418d/6EhTLwm-A8M.jpg\"><p>\r\nСпасибо Вам за прочтение данной статьи. Вы можете поддержать нас, вступив в группу проекта, лайкнув и репостнув этот пост.<br>\r\n<br>\r\nТак же предлагаем Вам вступить в наш сервер дискорд: <br>\r\n<a href=\"//discord.gg/cK3JEgK\">https://discord.gg/cK3JEgK</a> <br>\r\n<br>\r\nС уважением, команда проекта Union Role Play.<br>', 84, 1550145626, 'https://unionrp.ru/image/news/cover/news_cover_7.png'),
(8, 'Artyom Slyadnev', 'Открытые интерьеры банд', '', 'Видеоряд с районов гетто:<br>\r\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/qkOC0iak7LQ\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\r\n<br>\r\n<br>\r\nВ этом видео вы увидите 4 открытых,оптимизированных для массовой игры на нашем сервере интерьера. Все предыдущие видео вы видели до обновления визуальной составляющей.<br>\r\nТак-же был добавлен транспорт и несколько пасхалок для самых продвинутых и игроков серии GTA! Да-да, о вас мы тоже подумали! Приятного просмотра, мира вам и вашему дому!<br>\r\n<br>\r\nНа видео интерьеры банд:<br>\r\n<br>\r\n- The Families Gang<br>\r\nПо задумке Rockstar:<br>\r\nКенты́ (англ. The Families) — афроамериканская банда в Grand Theft Auto V, членом которой является один из главных героев — Франклин.<br>\r\nБанда занимает всю территорию районов Чемберлен-Хиллз, Строберри и часть арены Maze Bank. У Кентов идёт ожесточённое соперничество с соседствующей бандой Баллас,<br>\r\nа также с бандой на юго-востоке Ранчо под названием Вагос.<br>\r\n<br>\r\n<img src=\"https://pp.userapi.com/c852232/v852232310/c019b/GqX_hewvglk.jpg\"><p>\r\n<img src=\"https://pp.userapi.com/c852232/v852232310/c01ac/16ZEeHKRfks.jpg\"><p>\r\n<img src=\"https://pp.userapi.com/c852232/v852232310/c01b6/FSOf6BW38MQ.jpg\"><p>\r\n<br>\r\n-  The Vagos Gang<br>\r\nПо задумке Rockstar:<br>\r\nБанда Los Santos Vagos появилась в городе почти одновременно с другими бандами, примерно в 70-х или 80-х годах. Как именно сформировалась банда, неизвестно,<br> \r\nно скорее всего она отсоединилась от одной мексиканской общины, в результате чего она разделилась на две части: Лос-Сантос Вагос и Varrios Los Aztecas.<br>\r\nК Ацтекам Вагос относились крайне жестоко, даже несмотря на то, что они «одной крови». Также Вагос враждовали с другими бандами,<br>\r\nособенно с Grove Street (в настоящее время The Families Gang), бандой, которая крайне враждебна настроена к наркотикам.<br>\r\nБолее-менее хорошо Лос-Сантос Вагос относились к Баллам, то развязывая войну, то заключая перемирие, а также торгуя с ними наркотиками и оружием.<br>\r\nПосле возращения Карла Джонсона, бывшего лидера банды с Гроув-стрит, положение Вагос сильно поменялось.<br>\r\nНесмотря на то, что главными врагами Семей Гроув-стрит были Баллас, Вагос тоже немало досталось, так как Grove Street срывали поставки крэка в Сан-Фиерро и захватывали у нее территорию.<br>\r\n<br>\r\n<img src=\"https://pp.userapi.com/c852232/v852232310/c01d4/ssEWEIkDR_g.jpg\"><p>\r\n<img src=\"https://pp.userapi.com/c852232/v852232310/c01ca/KmtFCRIkJiI.jpg\"><p>\r\n<br>\r\n- The Marabunta Grande<br>\r\nПо задумке Rockstar:<br>\r\nБанда находится в состоянии войны с Varrios Los Aztecas за торговлю наркотиками и оружием в округе Блейн. У членов банды чаще всего, как правило, бывают тату на лице.<br>\r\nВпервые члены этой банды появляются в миссии «Father/Son», где они крадут лодку Майкла вместе с Джимми на борту.  Также они появляются в побочных миссиях Оскара Гузмана,<br>\r\nгде пытаются отобрать товар у Тревора. Членов этой банды можно найти на территории Восточного Лос-Сантоса, в основном в Эль-Бурро-Хайтс, а также на Веспуччи-Бич.<br>\r\nТакже они ошиваются в Восточном Вайнвуде и рядом с Миррор-Парком. В основном, они активны по ночам. Если их спровоцировать, то сразу же начинают атаковать.<br>\r\nВозможно, эта банда скопирована с существующей банды Mara Salvatrucha.<br>\r\n<br>\r\n<img src=\"https://pp.userapi.com/c852232/v852232310/c01de/MxwY5SQIOCg.jpg\"><p>\r\n<img src=\"https://pp.userapi.com/c852232/v852232310/c01e8/Fgt3P9EqCqI.jpg\"><p>\r\n<img src=\"https://pp.userapi.com/c852232/v852232310/c01f2/1ti9SV3EVZE.jpg\"><p>\r\n<br>\r\n-  The Ballas Gang<br>\r\nПо задумке Rockstar:<br>\r\nБаллас — афроамериканская преступная группировка. В 80-х и 90-х была самой сильной бандой Лос-Сантоса. Имела половину территории города, включая Глен-Парк,<br>\r\nАйдлвуд, две территории Ист-Бич и ещё немало районов города. Прибыль банда получает с торговли наркотиками и оружием, «крышевания», рэкета, а также сутенёрства.<br>\r\nЧлены Баллас носят одежду пурпурного цвета: пурпурные куртки, рубашки, как правило, мешковатые шорты и банданы.<br>\r\nЗаклятые враги банды — другая афроамериканская банда Семьи Гроув-стрит, также у Балласов напряжённые отношения с Триадами и Варриос Лос Ацтекас.<br>\r\nБаллас сотрудничают в наркоторговле с бандами Вагос Лос-Сантоса, Рифа Сан-Фиерро, Синдикат Локо и коррумпированной организацией C.R.A.S.H. По оружейным сделкам — с русской мафией.<br>\r\n<br>\r\n<img src=\"https://pp.userapi.com/c846420/v846420394/1a84d6/hEfvzQw7i-M.jpg\"><p>\r\n<img src=\"https://pp.userapi.com/c846420/v846420394/1a84b8/9ugKi4aCnZY.jpg\"><p>\r\n<img src=\"https://pp.userapi.com/c846420/v846420394/1a84c2/SwXTPib52PE.jpg\"><p>\r\n<img src=\"https://pp.userapi.com/c846420/v846420394/1a84cc/Swr7i7GH8KU.jpg\"><p>\r\nМы уверены, что вы посмотрели это видео с большим удовольствием!<br>\r\nХочешь быть во главе одной и банд? Пиши в комментарии и свой ник, который будет у тебя на нашем сервере! Пиши, что бы ты хотел видеть в будущем на своём районе? <br>\r\nЛучшие комментарии будут отсортировываться и воплощаться в ближайшее время! Лучшие авторы идей, получат бонус!<br>\r\n<br>\r\nСпасибо Вам за прочтение данной статьи. Вы можете поддержать нас, вступив в группу проекта, лайкнув и репостнув этот пост.<br>\r\n<br>\r\nТак же предлагаем Вам вступить в наш сервер дискорд: <br>\r\n<a href=\"//discord.gg/cK3JEgK\">https://discord.gg/cK3JEgK</a> <br>\r\n<br>\r\nС уважением, команда проекта Union Role Play.<br>', 105, 1550587226, 'https://unionrp.ru/image/news/cover/news_cover_8.png'),
(9, 'Artyom Slyadnev', 'Банкоматы, удостоверения и планшеты', '', 'Продолжаем удивлять вас нашими обновлениями. Сегодня мы покажем вам технологии и возможности, которые вас ждут при открытии сервера.<br>\r\n<br>\r\nВы готовы? Тогда поехали! :)<br>\r\n<br>\r\n* Банкоматы<br>\r\nНеотъемлемая часть сервера. Обратите внимание на простоту и удобство, выполняя операцию в банкомате. Вы не ошибётесь с переводом денег на счёт другого клиента банка,<br>\r\nтак как функция подтверждения перевода и информации о получателе не позволит вам допустить это ошибку.<br>\r\n<br>\r\n<img src=\"https://pp.userapi.com/c852236/v852236137/c9987/3LVHjqI-SzY.jpg\"><p>\r\n<img src=\"https://pp.userapi.com/c852236/v852236137/c9991/9ydIINEL4q4.jpg\"><p>\r\n<img src=\"https://pp.userapi.com/c852236/v852236137/c999b/bg1ZqJbL_O0.jpg\"><p>\r\n* Удостоверения LSPD и FIB<br>\r\nОтыгрывая роль сотрудника LSPD или FIB вам не придется объяснять на словах кто вы такой. Достаточно просто показать игроку, стоящего напротив вас, удостоверение.<br>\r\nУвидев жетон на внутренней стороне и краткую информацию о вас у игрока отпадут сомнения.<br>\r\n<br>\r\n<img src=\"https://pp.userapi.com/c849024/v849024304/132162/bc6lMixJTro.jpg\"><p>\r\n<img src=\"https://pp.userapi.com/c848624/v848624630/13d829/5juCn_gupG0.jpg\"><p>\r\n* Планшеты<br>\r\nПланшет сотрудника государственной организации — это информационный носитель, ваш второй друг, который всегда подскажет и поможет вам если вы попали в беду.<br>\r\n<br>\r\nЧто из интересного?<br>\r\n• Единая база данных<br>\r\n• Поиск преступника<br>\r\n• Запросить помощь по экстренной связи и многое другое<br>\r\n<br>\r\nПланшет LSMC<br>\r\n<img src=\"https://pp.userapi.com/c849024/v849024304/13216a/MoDAFxMTdKM.jpg\"><p>\r\nПланшет LSPD<br>\r\n<img src=\"https://pp.userapi.com/c851416/v851416137/c8448/k48nmc5jt1o.jpg\"><p>\r\nПланшет FIB<br>\r\n<img src=\"https://pp.userapi.com/c849420/v849420630/139360/X3NUUSPM7Yk.jpg\"><p>\r\nСпасибо Вам за прочтение данной статьи. Вы можете поддержать нас, вступив в группу проекта, лайкнув и репостнув этот пост.<br>\r\n<br>\r\nТак же предлагаем Вам вступить в наш сервер дискорд: <br>\r\n<a href=\"//discord.gg/cK3JEgK\">https://discord.gg/cK3JEgK</a> <br>\r\n<br>\r\nС уважением, команда проекта Union Role Play.<br>', 89, 1550969126, 'https://unionrp.ru/image/news/cover/news_cover_9.png'),
(10, 'Artyom Slyadnev', 'Система такси v 1.0', '', 'Всем привет, будем краткими в этот раз, действительно работаем так, что не замечаем как время идёт.<br>\nВ этом видео мы для вас отсняли функционал такси, конечно какие-то детали будут дополняться и лишнее уберётся, но,<br>\nна данный момент такси уже полностью играбельно даже с учетом первичных Sullenов, жуки уничтожены.<br>\n<br>\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/OYzhQymTEps\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe><br>\n<br>\nЗолотое правило нашей команды, заключается в том, чтобы всем было проще, все таки это что то новое, нежели старый добрый samp.<br>\nУ нас большое количество функционала будет автоматизировано! Вам больше не придется отыгрывать банальные вещи через тот же «/me»<br>\nТак же мы и поступили с такси. Все просто и понятно!<br>\nВы, через телефон (который будет показан в ближайшее время) вызываете такси, Ваш заказ принимает один из водителей,<br>\nвезде приходят уведомления для понимания каждого действия из двух сторон — водителя и пассажира.<br>\n<br>\n<img src=\"https://pp.userapi.com/c850620/v850620699/c3a77/V-7OYnJHyPk.jpg\" style=\"width: 500; height: 500;\"><p>\n\nПосле посадки в такси, ваши действия:<br>\nОткрыть карту на «ESC»<br>\nПоставить метку на карте в любом месте.<br>\nПосле выбора места прибытия, закройте карту и нажмите на (анг). «E» <br>\nКак только вы поставите метку, будет автоматически рассчитана сумма Вашей поездки. Самое главное, если вы решите выйти на пол пути или на 5% от пути,<br>\nто деньги спишут именно за Distance — которое вы проехали!<br>\n<br>\nДоброго пути!<br>\n<br>\n<img src=\"https://pp.userapi.com/c850620/v850620699/c3aae/GmHJxT8sD1w.jpg\"><p>\n<img src=\"https://pp.userapi.com/c850620/v850620699/c3ab8/u2vDgtPAa9s.jpg\"><p>\n<img src=\"https://pp.userapi.com/c849120/v849120816/12dc23/cSJeyN2PJH0.jpg\"><p>\n<img src=\"https://pp.userapi.com/c849332/v849332816/13d603/RrjPCYIXmaM.jpg\"><p>\nСо стороны водителя:<br>\nУстроившись на работу в такси, вы входите в приложение такси «Downtown Cab Company» под своим именем и паролем!<br>\n<br>\n<img src=\"https://pp.userapi.com/c850432/v850432699/caf90/n5BvYMCo708.jpg\"><p>\n<img src=\"https://pp.userapi.com/c850432/v850432699/caf9a/IKq1tkeBygE.jpg\"><p>\n<img src=\"https://pp.userapi.com/c850432/v850432699/cafa4/VM65zeT5m14.jpg\"><p>\n<img src=\"https://pp.userapi.com/c850432/v850432699/cafae/B9DIxgzCRvM.jpg\"><p>\nТеперь вы готовы творить!<br>\nЕсть два вида отображения приложения DTCabCo, в обычном (развернутом) режиме, и в режиме компактного меню, где будет указаны данные о поездки.<br>\nЧтобы менять режим отображения нажмите «Numpad0»<br>\nЗаказы приходят в режиме реального времени, вам не нужно обновлять список в ручную, что очень приятно и комфортно в потоке заказов.<br>\n<br>\n<img src=\"https://pp.userapi.com/c850432/v850432699/cafc1/lXZB54L_t8Q.jpg\"><p>\n<img src=\"https://pp.userapi.com/c850432/v850432699/cafcb/Q_bUA9wxO1o.jpg\"><p>\n<img src=\"https://pp.userapi.com/c850432/v850432699/cafd5/B7iUPvRxgIw.jpg\"><p>\n<img src=\"https://pp.userapi.com/c850432/v850432699/cafdf/fcmDcYYp97w.jpg\"><p>\nВ кратце мы показали вам как можно работать водителем такси, остальную навигацию нововведения вы увидите в игре!<br>\n<br>\nВажно!<br>\nПросим вас не обращать на второй план в видео, какие-то детали будут изменены в целом.<br>\n<br>\nБонус!<br>\nВ комментариях по видео, предлагайте свои идеи и дополнительные функции для приложения такси! Самая лучшая идея будет реализована на открытии сервера,<br>\nа её создатель получит вознаграждение на свой аккаунт!<br>\nКомментарии обязательно должны быть под видео на нашем YouTube канале!<br>\nНаш канал YouTube: <a href=\"//www.youtube.com/unionroleplay\"> https://www.youtube.com/unionroleplay</a> <br>\nСпасибо Вам за прочтение данной статьи. Вы можете поддержать нас, вступив в группу проекта, лайкнув и репостнув этот пост.<br>\n<br>\nТак же предлагаем Вам вступить в наш сервер дискорд: <br>\n<a href=\"//discord.gg/cK3JEgK\">https://discord.gg/cK3JEgK</a> <br>\n<br>\nС уважением, команда проекта Union Role Play.<br>', 134, 1551056726, 'https://unionrp.ru/image/news/cover/news_cover_10.png'),
(11, 'Artyom Slyadnev', 'Меню домов + бонус', '', 'Доброго времени суток, дорогие друзья!<br>\r\nХотим сказать спасибо за вашу активность и поддержку!<br>\r\nОсталось совсем немного до открытия, поэтому делимся с вами маленькой частью того, что мы сделали. <br>\r\nЖелаем вам приятного просмотра, нам интересно узнать ваше мнение!<br>\r\nОбязательно оставляйте комментарии с вашими предложениями и пожеланиями, возможно, именно твоя идея будет полезна для игроков и реализована в игре!<br>\r\nГлядишь, что-то новое появится<br>\r\n<br>\r\n<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/rzlj4pChITI\" frameborder=\"0\" allow=\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen></iframe>\r\n<br>\r\n<br>\r\nТак же предлагаем Вам вступить в наш сервер дискорд: <br>\r\n<a href=\"//discord.gg/cK3JEgK\">https://discord.gg/cK3JEgK</a> <br>\r\n<br>\r\nС уважением, команда проекта Union Role Play.<br>', 258, 1551812400, 'https://unionrp.ru/image/news/cover/news_cover_1.png');
