(213, 'create_biz', 'create_biz', 'Создать бизнес. Маркер ставится по позиции игрока.<br/>Тип:<br/>1 - закусочная<br/>2 - бар<br/>3 - магазин одежды<br/>4 - барбершоп<br/>5 - АЗС<br/>6 - 24/7<br/>7 - тату салон<br/>8 - оружейный магазин<br/>9 - автосалон<br/>10 - LS Customs<br/>11 - СТО', 9),
(214, 'create_house', 'create_house', 'Создать новый дом. Позиция Exitа из дома берётся по положению игрока (не забывайте про поворот туловища, чтобы игрок смотрел в противоп. сторону от двери).', 9),
(215, 'mute', 'mute', 'Выдать мут игроку.', 2),
(216, 'unmute', 'unmute', 'Снять мут с игрока.', 2),
(217, 'give_licenses', 'give_licenses', 'Выдать все License игроку.', 3);
